import IconButton from '@mui/material/IconButton';
import Stack from '@mui/material/Stack';
import DeleteIcon from '@mui/icons-material/Delete';

const Todo = ({todo, index, completeTask, removeTask}) => {

  function IconButtons() {
    return (
        <Stack direction="row" spacing={1}>
          <IconButton aria-label="delete">
            <DeleteIcon/>
          </IconButton>
          <IconButton aria-label="delete" disabled color="primary">
            <DeleteIcon/>
          </IconButton>
        </Stack>
    );
  }

  return (
      <div id={todo.id} key={todo.key} className={todo.complete ? "todo strike" : "todo "}>
        <p>
          {todo.key}
        </p>
        <div className={'btnWrap'}>
          <button className={'btn'} onClick={() => completeTask(index)}>
            Complete
          </button>
          <button className={'btn'} onClick={() => removeTask(index)}>
            X
          </button>
        </div>
      </div>
  );
};

export default Todo;
